import './App.css';
import Header from './components/Header/Header';

import {useState} from 'react';

import {BrowserRouter as Router, Routes,Route} from 'react-router-dom'



function App() {

  return (
    <div className= "App">

      <Router>

        <Routes>
            <Route exact='/' element={<Header />} />
        </Routes>
      </Router>


    </div>
  );
}

export default App;
